import React, {Component} from 'react';

class Pagination extends Component{
	constructor(props){
		super(props);
	}

	handleClick(page){
		this.props.handleClick(page);
	}

	render(){
		let disablePrev = false;
		if(this.props.currentPage == 1)
			disablePrev = true;
		return (
			<div className="filter-main-container">
				<button className="btn" onClick={this.handleClick.bind(this, this.props.currentPage-1)}>Prev</button>
				<div>Page <span>{this.props.currentPage}</span></div>
				<button className="btn" onClick={this.handleClick.bind(this, this.props.currentPage+1)}>Next</button>
		     </div>
			);
	}
}

export default Pagination;
